import React, { Component } from 'react';

class DataView extends Component {
    render() { 

         return(
            <div>
                {
                    this.props.visible 
                    ?<div>
                        <p>dataview showing</p>
                    </div>
                    :<div></div>
                }
            </div>
         )
    }
}
 
export default DataView;
